(1354, 1625, 'session', '14', '{\"id\":\"14\",\"status\":\"draft\",\"created_on\":\"2020-09-15 18:23:28\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:47:59\",\"title\":\"K\\u00f6rper komplexes Schauspiel\",\"url\":\"korper-komplexes-schauspiel\",\"sort\":null,\"description\":\"<h3>7 Emotionen, K&ouml;rper, komplexes Schauspielen&nbsp; (Kirby)<\\/h3>\\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch den K&ouml;rper auszudr&uuml;cken. \\\"Komplexes Schauspielen\\\" hei&szlig;t sich voll und ganz in die Rolle hineinzuversetzen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.<\\/p>\\n<p><em>Zuletzt aktualisiert: 15.09.2020<\\/em><\\/p>\",\"break_time\":\"20\",\"point_of_interest\":\"body\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1355, 1626, 'session', '8', '{\"id\":\"8\",\"status\":\"draft\",\"created_on\":\"2020-08-23 09:25:57\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:06\",\"title\":\"Mimik Einfaches Schauspielen\",\"url\":\"mimik-einfaches-schauspielen\",\"sort\":\"1\",\"description\":\"<h3>7 Emotionen, Mimik, einfaches Schauspielen&nbsp; (Kirby)<\\/h3>\\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch das Gesicht auszudr&uuml;cken. \\\"Einfaches Schauspielen\\\" hei&szlig;t: nicht lange nachdenken, einfach losspielen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.<\\/p>\\n<p><em>Zuletzt aktualisiert: 28.08.2020<\\/em><\\/p>\",\"break_time\":\"20\",\"point_of_interest\":\"face\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1356, 1627, 'session', '23', '{\"id\":\"23\",\"status\":\"draft\",\"created_on\":\"2020-10-19 09:49:11\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:15\",\"title\":\"Singen Wiwiwiwi\",\"url\":\"singen-wiwiwiwi\",\"sort\":null,\"description\":\"<p>Diese &Uuml;bung k&ouml;nnt ihr einfach machen, wie wir sie schon kennen. Gerne aufsteigend, mal auf &bdquo;Wi&ldquo; und mal auf &bdquo;W&uuml;&ldquo;. Daf&uuml;r habt ihr 45 Sekunden Zeit, in der ihr das auf eure Art und Weise machen k&ouml;nnt (hei&szlig;t: schnell, langsam, laut, leise etc.).<\\/p>\\n<p>Zuletzt aktualisiert: 19.10.2020<\\/p>\\n<p>&nbsp;<\\/p>\\n<p>&nbsp;<\\/p>\",\"break_time\":\"5\",\"point_of_interest\":\"sound\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1357, 1628, 'session', '22', '{\"id\":\"22\",\"status\":\"draft\",\"created_on\":\"2020-10-18 20:09:12\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:21\",\"title\":\"Singen UAEIO\",\"url\":\"singen-uaeio\",\"sort\":null,\"description\":\"<p>Bei dieser Session bitte die Vokale UAEIO getrennt voneinander jeweils f&uuml;r ca. 6 Sekunden - pro &Uuml;bung ein Vokal. Dabei ist die Tonh&ouml;he vollkommen egal, ihr k&ouml;nnt es auf - oder absteigend oder v&ouml;llig durcheinander machen.<\\/p>\\n<p>Zuletzt aktualisiert am 19.10.2020.<\\/p>\",\"break_time\":\"4\",\"point_of_interest\":\"sound\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1358, 1629, 'session', '24', '{\"id\":\"24\",\"status\":\"draft\",\"created_on\":\"2020-10-19 09:54:23\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:28\",\"title\":\"Singen Sch\\u00f6ner Wohnen\",\"url\":\"singen-schoner-wohnen\",\"sort\":null,\"description\":\"<div>Die &Uuml;bung kennt ihr auch. Fangt m&ouml;glichst tief an, sodass ihr Raum nach oben habt.<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>Aufsteigend, in eurem Tempo, f&uuml;r 50 Sekunden.<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>Zuletzt aktualisiert: 19.10.2020<\\/div>\",\"break_time\":\"5\",\"point_of_interest\":\"sound\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1359, 1630, 'session', '18', '{\"id\":\"18\",\"status\":\"draft\",\"created_on\":\"2020-09-26 18:20:00\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:35\",\"title\":\"Mimik Komplexes Schauspiel\",\"url\":\"mimik-komplexes-schauspiel\",\"sort\":null,\"description\":\"<p>Lasst euch Zeit Mimik Komplexes Schauspiel<\\/p>\",\"break_time\":\"10\",\"point_of_interest\":\"face\"}', '{\"status\":\"draft\"}', NULL, NULL, NULL),
(1360, 1631, 'session', '32', '{\"id\":\"32\",\"status\":\"published\",\"created_on\":\"2021-01-23 19:45:58\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:48:45\",\"title\":\"Traum Text\",\"url\":\"traum-text\",\"sort\":null,\"description\":\"<p>spiele den Text in der gegebenen Emotion<\\/p>\",\"break_time\":\"10\",\"point_of_interest\":\"face\"}', '{\"status\":\"published\"}', NULL, NULL, NULL);
INSERT INTO `directus_revisions` (`id`, `activity`, `collection`, `item`, `data`, `delta`, `parent_collection`, `parent_item`, `parent_changed`) VALUES
(1361, 1632, 'session', '32', '{\"id\":\"32\",\"status\":\"published\",\"created_on\":\"2021-01-23 19:45:58\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-23 19:55:58\",\"title\":\"Traum Text\",\"url\":\"traum-text\",\"sort\":null,\"description\":\"<p><span style=\\\"color: rgba(255, 255, 255, 0.9); font-family: Inter, \'Helvetica Neue\', \'Source Sans Pro\', \'Source Han Sans SC\', \'Source Han Sans CN\', \'Hiragino Sans GB\', \'Hiragino Kaku Gothic\', \'Microsoft Yahei UI\', Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: -0.14px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #2c6bed; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\\\">ch hab eine seltene Vision gehabt. Ich hab einen Traum gehabt &mdash; das geht &uuml;ber Menschenverstand zu sagen, was das f&uuml;r ein Traum war. Mir war, ich w&auml;r &mdash; kein Mensch kann sagen, was. Mir war, ich w&auml;r &mdash; und mir war, ich h&auml;tt &mdash; aber der Mensch ist nur ein Narr, wenn er sich erdreistet zu sagen, was mir war, dass ich h&auml;tt. Des Menschen Auge hat\'s noch nicht geh&ouml;rt, des Menschen Ohr hat\'s noch nicht gesehn, des Menschen Hand kann\'s nicht schmecken, seine Zunge nicht erfassen und sein Herz nicht erz&auml;hlen, was mein Traum&nbsp;war!&rdquo;<\\/span><\\/p>\",\"break_time\":\"10\",\"point_of_interest\":\"face\"}', '{\"description\":\"<p><span style=\\\"color: rgba(255, 255, 255, 0.9); font-family: Inter, \'Helvetica Neue\', \'Source Sans Pro\', \'Source Han Sans SC\', \'Source Han Sans CN\', \'Hiragino Sans GB\', \'Hiragino Kaku Gothic\', \'Microsoft Yahei UI\', Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: -0.14px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #2c6bed; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\\\">ch hab eine seltene Vision gehabt. Ich hab einen Traum gehabt &mdash; das geht &uuml;ber Menschenverstand zu sagen, was das f&uuml;r ein Traum war. Mir war, ich w&auml;r &mdash; kein Mensch kann sagen, was. Mir war, ich w&auml;r &mdash; und mir war, ich h&auml;tt &mdash; aber der Mensch ist nur ein Narr, wenn er sich erdreistet zu sagen, was mir war, dass ich h&auml;tt. Des Menschen Auge hat\'s noch nicht geh&ouml;rt, des Menschen Ohr hat\'s noch nicht gesehn, des Menschen Hand kann\'s nicht schmecken, seine Zunge nicht erfassen und sein Herz nicht erz&auml;hlen, was mein Traum&nbsp;war!&rdquo;<\\/span><\\/p>\"}', NULL, NULL, NULL),
(1362, 1633, 'session', '8', '{\"id\":\"8\",\"status\":\"published\",\"created_on\":\"2020-08-23 09:25:57\",\"modified_by\":\"5\",\"modified_on\":\"2021-01-24 17:17:07\",\"title\":\"Mimik Einfaches Schauspielen\",\"url\":\"mimik-einfaches-schauspielen\",\"sort\":\"1\",\"description\":\"<h3>7 Emotionen, Mimik, einfaches Schauspielen&nbsp; (Kirby)<\\/h3>\\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch das Gesicht auszudr&uuml;cken. \\\"Einfaches Schauspielen\\\" hei&szlig;t: nicht lange nachdenken, einfach losspielen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.<\\/p>\\n<p><em>Zuletzt aktualisiert: 28.08.2020<\\/em><\\/p>\",\"break_time\":\"20\",\"point_of_interest\":\"face\"}', '{\"status\":\"published\"}', NULL, NULL, NULL);
