(1, 'deleted', '2020-07-06 12:01:47', 1, '2020-07-07 12:25:06', 'Test Session', 'test-session', NULL, '<p>This is a description</p>', 20, NULL),
(2, 'deleted', '2020-07-06 13:09:14', 1, '2020-07-07 12:25:06', 'Another Session', 'another-session', NULL, NULL, 20, NULL),
(3, 'deleted', '2020-07-06 13:10:42', 1, '2020-07-07 12:25:07', 'Unpublished Session', 'unpublished-session', NULL, NULL, 20, NULL),
(4, 'deleted', '2020-07-07 12:27:53', 5, '2020-08-23 09:56:28', 'Demonstration', 'demonstration', NULL, '<p>This is a short description.</p>', 5, NULL),
(5, 'deleted', '2020-08-11 14:14:08', 5, '2020-08-23 09:56:27', 'Another Session 2', 'another-session-2', NULL, '<p>Hello World.</p>', 20, NULL),
(6, 'deleted', '2020-08-17 13:13:00', 5, '2020-08-23 09:56:27', 'Test Session Hello', 'test-session-hello', NULL, '<p>Hello, welcome to the session.</p>', 20, NULL),
(7, 'deleted', '2020-08-20 18:07:44', 5, '2020-08-23 09:40:10', 'gilbertskitch', 'gilbertskitch', NULL, '<p>every emotion acted in different styles&nbsp;</p>\n<p>one after another&nbsp;</p>\n<p>keep aware of the distance&nbsp;</p>', 20, NULL),
(8, 'published', '2020-08-23 09:25:57', 5, '2021-01-24 17:17:07', 'Mimik Einfaches Schauspielen', 'mimik-einfaches-schauspielen', 1, '<h3>7 Emotionen, Mimik, einfaches Schauspielen&nbsp; (Kirby)</h3>\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch das Gesicht auszudr&uuml;cken. \"Einfaches Schauspielen\" hei&szlig;t: nicht lange nachdenken, einfach losspielen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.</p>\n<p><em>Zuletzt aktualisiert: 28.08.2020</em></p>', 20, 'face'),
(9, 'draft', '2020-08-28 09:52:24', 5, '2021-01-23 19:47:48', 'Körper Einfaches Schauspielen', 'koerper-einfaches-schauspielen', 2, '<h3>7 Emotionen, K&ouml;rper, einfaches Schauspielen&nbsp; (Kirby)</h3>\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch den K&ouml;rper auszudr&uuml;cken. \"Einfaches Schauspielen\" hei&szlig;t: nicht lange nachdenken, einfach losspielen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.</p>\n<p><em>Zuletzt aktualisiert: 28.08.2020</em></p>', 20, 'body'),
(10, 'draft', '2020-08-28 10:01:39', 5, '2020-09-26 18:26:13', 'Stimme Einfaches Schauspielen', 'stimme-einfaches-schauspielen', 3, '<h3>7 Emotionen, Stimme, einfaches Schauspielen&nbsp; (Kirby)</h3>\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch die Stimme (Laute, Ger&auml;usche, Worte) auszudr&uuml;cken. \"Einfaches Schauspielen\" hei&szlig;t: nicht lange nachdenken, einfach losspielen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.</p>\n<p><em>Zuletzt aktualisiert: 28.08.2020</em></p>', 10, 'face'),
(11, 'draft', '2020-09-01 17:24:06', 1, '2020-11-04 16:08:30', 'Gilberts Debug and Test', 'gilberts-debug-and-test', NULL, '<p>Example of an audio exercise or session.</p>', 20, 'sound'),
(12, 'deleted', '2020-09-03 15:50:49', 4, '2020-09-03 15:51:01', 'Mimik2 Einfaches Schauspielen', 'mimik2-einfaches-schauspielen', NULL, '', 20, 'face'),
(13, 'draft', '2020-09-11 12:46:47', 5, '2020-09-14 15:43:57', 'Meredith_Debug', 'meredith_debug', NULL, '<p>Test session</p>', 20, 'face'),
(14, 'draft', '2020-09-15 18:23:28', 5, '2021-01-23 19:47:59', 'Körper komplexes Schauspiel', 'korper-komplexes-schauspiel', NULL, '<h3>7 Emotionen, K&ouml;rper, komplexes Schauspielen&nbsp; (Kirby)</h3>\n<p>Hier &uuml;ben wir Angst, Freude, &Uuml;berraschung, Liebe, Trauer, Verachtung und Wut durch den K&ouml;rper auszudr&uuml;cken. \"Komplexes Schauspielen\" hei&szlig;t sich voll und ganz in die Rolle hineinzuversetzen. Jedes Gef&uuml;hl f&uuml;r 30 Sekunden. Eselsbr&uuml;cke f&uuml;r die Reihenfolge: AF&Uuml;LTVW.</p>\n<p><em>Zuletzt aktualisiert: 15.09.2020</em></p>', 20, 'body'),
(15, 'deleted', '2020-09-15 18:35:55', 4, '2020-10-19 09:47:28', 'Vokale', 'vokale', NULL, '<p>Vokale f&uuml;r 5 Sekunden</p>', 10, 'sound'),
(16, 'deleted', '2020-09-22 15:03:21', 4, '2020-10-19 09:47:35', 'TestNeu', 'testneu', NULL, '<p>Test Session</p>', 21, 'face'),
(17, 'deleted', '2020-09-22 17:19:14', 4, '2020-10-19 09:47:45', 'TestNeu2', 'testneu2', NULL, '<p>&auml;</p>', 20, 'body'),
(18, 'draft', '2020-09-26 18:20:00', 5, '2021-01-23 19:48:35', 'Mimik Komplexes Schauspiel', 'mimik-komplexes-schauspiel', NULL, '<p>Lasst euch Zeit Mimik Komplexes Schauspiel</p>', 10, 'face'),
(19, 'deleted', '2020-10-14 12:35:37', 5, '2020-10-18 19:48:58', 'AEIOU', 'aeiou', NULL, '<p>A E I O U </p>\n<p>Jeweils 6 Sekunden.</p>\n<p>Zuletzt aktualisiert: 14.10.2020</p>\n<p>&nbsp;</p>', 5, 'face'),
(20, 'draft', '2020-10-18 19:30:10', 5, '2021-01-23 19:46:34', 'Einsprechakrobatik 1 lalala', 'einsprechakrobatik-1-lalala', NULL, '<p>Jede einzelne Sprech&uuml;bung wird zweimal wiederholt.</p>\n<p>Zuletzt aktualisiert: 19.10.2020</p>', 5, 'sound'),
(21, 'draft', '2020-10-18 19:48:39', 5, '2021-01-23 19:46:49', 'Einsprechakrobatik 6 Weiche und Harte Konsonanten', 'einsprechakrobatik-6-weiche-und-harte-konsonanten', NULL, '<p>Bo Do Go - Po To Ko</p>\n<p>Jeweils 3 mal hintereinander weiche und anschlie&szlig;end 3 mal die harten Konsonanten.</p>\n<p>Zuletzt aktualieiert: 19.10.2020</p>', 3, 'sound'),
(22, 'draft', '2020-10-18 20:09:12', 5, '2021-01-23 19:48:21', 'Singen UAEIO', 'singen-uaeio', NULL, '<p>Bei dieser Session bitte die Vokale UAEIO getrennt voneinander jeweils f&uuml;r ca. 6 Sekunden - pro &Uuml;bung ein Vokal. Dabei ist die Tonh&ouml;he vollkommen egal, ihr k&ouml;nnt es auf - oder absteigend oder v&ouml;llig durcheinander machen.</p>\n<p>Zuletzt aktualisiert am 19.10.2020.</p>', 4, 'sound'),
(23, 'draft', '2020-10-19 09:49:11', 5, '2021-01-23 19:48:15', 'Singen Wiwiwiwi', 'singen-wiwiwiwi', NULL, '<p>Diese &Uuml;bung k&ouml;nnt ihr einfach machen, wie wir sie schon kennen. Gerne aufsteigend, mal auf &bdquo;Wi&ldquo; und mal auf &bdquo;W&uuml;&ldquo;. Daf&uuml;r habt ihr 45 Sekunden Zeit, in der ihr das auf eure Art und Weise machen k&ouml;nnt (hei&szlig;t: schnell, langsam, laut, leise etc.).</p>\n<p>Zuletzt aktualisiert: 19.10.2020</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 5, 'sound'),
(29, 'draft', '2020-11-22 14:48:37', 5, '2021-01-23 19:47:36', 'Einsprechakrobatik 5 - ballalala', 'einsprechakrobatik-5-ballalala', NULL, '<p>ballalaLA ballalaLO</p>', 5, 'sound'),
(30, 'deleted', '2021-01-02 10:30:29', 5, '2021-01-02 10:30:29', '', '', NULL, NULL, 20, NULL),
(25, 'draft', '2020-11-09 20:35:26', 5, '2020-11-15 12:32:40', 'hallo welt', 'hallo-welt', NULL, '<p>10 Sek \"Hallo Welt\" schrein, Angst</p>', 20, 'face'),
(26, 'draft', '2020-11-15 12:36:13', 5, '2021-01-23 19:47:17', 'einsprechakrobatik 2 Schwallasop', 'einsprechakrobatik-2-schwallasop', NULL, '', 20, 'sound'),
(27, 'draft', '2020-11-15 15:18:21', 5, '2021-01-23 19:47:22', 'einsprechakrobatik 3 wosozojo', 'einsprechakrobatik-3-wosozojo', NULL, NULL, 20, 'sound'),
(28, 'draft', '2020-11-15 15:23:35', 5, '2021-01-23 19:47:29', 'einsprechakrobatik 4 monomo', 'einsprechakrobatik-4-monomo', NULL, '<p>Immer die letzte Silbe wechselt den Vokal oder Umlaut</p>', 20, 'sound'),
(24, 'draft', '2020-10-19 09:54:23', 5, '2021-01-23 19:48:28', 'Singen Schöner Wohnen', 'singen-schoner-wohnen', NULL, '<div>Die &Uuml;bung kennt ihr auch. Fangt m&ouml;glichst tief an, sodass ihr Raum nach oben habt.</div>\n<div>&nbsp;</div>\n<div>Aufsteigend, in eurem Tempo, f&uuml;r 50 Sekunden.</div>\n<div>&nbsp;</div>\n<div>Zuletzt aktualisiert: 19.10.2020</div>', 5, 'sound'),
(31, 'draft', '2021-01-21 15:35:17', 5, '2021-01-21 15:35:17', 'liebes uebung', 'liebes-uebung', NULL, NULL, 20, NULL),
(32, 'published', '2021-01-23 19:45:58', 5, '2021-01-23 19:55:58', 'Traum Text', 'traum-text', NULL, '<p><span style=\"color: rgba(255, 255, 255, 0.9); font-family: Inter, \'Helvetica Neue\', \'Source Sans Pro\', \'Source Han Sans SC\', \'Source Han Sans CN\', \'Hiragino Sans GB\', \'Hiragino Kaku Gothic\', \'Microsoft Yahei UI\', Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: -0.14px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #2c6bed; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">ch hab eine seltene Vision gehabt. Ich hab einen Traum gehabt &mdash; das geht &uuml;ber Menschenverstand zu sagen, was das f&uuml;r ein Traum war. Mir war, ich w&auml;r &mdash; kein Mensch kann sagen, was. Mir war, ich w&auml;r &mdash; und mir war, ich h&auml;tt &mdash; aber der Mensch ist nur ein Narr, wenn er sich erdreistet zu sagen, was mir war, dass ich h&auml;tt. Des Menschen Auge hat\'s noch nicht geh&ouml;rt, des Menschen Ohr hat\'s noch nicht gesehn, des Menschen Hand kann\'s nicht schmecken, seine Zunge nicht erfassen und sein Herz nicht erz&auml;hlen, was mein Traum&nbsp;war!&rdquo;</span></p>', 10, 'face');
